import React from 'react';
// import logo from './logo.svg';
import './App.css';
import "bootstrap/dist/css/bootstrap.min.css";
import ExercisesView from "./components/exercises/exercises";
import AddExercisesView from "./components/exercises/add";
import EditExercisesView from "./components/exercises/edit";

import WorkoutsView from "./components/workouts/workouts";
import AddWorkoutsView from "./components/workouts/add";
import EditWorkoutsView from "./components/workouts/edit";

import ProfileView from "./components/profile/profile";
import EditProfileView from "./components/profile/edit";

import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  Redirect,
  useHistory,
  useLocation,
} from "react-router-dom";


function App() {
  console.log("walls");
  return (
<Router>
      <div>
        {/* <Nav logout={setLoggedIn} loginStatus={loggedIn} /> */}

        {/* A <Switch> looks through its children <Route>s and
            renders the first one that matches the current URL. */}
        <Switch>
          <Route component={AddExercisesView} path="/exercises/add"/>
          <Route component={EditExercisesView} path="/exercises/edit"/>
          <Route component={ExercisesView} path="/exercises"/>

          <Route component={WorkoutsView} path="/workouts"/>
          <Route component={AddWorkoutsView} path="/workouts/add"/>
          <Route component={EditWorkoutsView} path="/workouts/edit"/>

          <Route component={ProfileView} path="/profile"/>
          <Route component={EditWorkoutsView} path="/profile/edit"/>

        </Switch>
      </div>
    </Router>
  );
}

export default App;
